import React from "react";
import CarouselComponentNow from "./(utils)/CarouselNow";

const TrendingNow = () => {
  return (
    <div className="flex flex-col gap-5 pl-10 pt-10 border-2">
      <div className="text-xl font-bold flex flex-row gap-10 items-center">
        <div className="p-1">Trending Today</div>
      </div>
      <div className="border-2">
        <CarouselComponentNow />
      </div>
    </div>
  );
};

export default TrendingNow;
